import React, { useState } from "react";

function App() {
  const [text, settext] = useState(0);
  const[isShow , setisShow] = useState(true)
  const Increase = () => {
    settext(text + 1);
  };
  const Decrease = () => {
    settext(text - 1);
  };
  const ShowHide = ()=>{
setisShow(!isShow)
  }

  return (
    <div>
      <h2>{text}</h2>
      <button onClick={Increase}>Increase me!</button>
      <button onClick={Decrease}>Decrease me!</button>
      <br />
      {isShow === true ? <h2>Wecome</h2>: null}
      <button onClick = {ShowHide}>Hide</button>
    </div>
  );
}

export default App;
